import React from "react";
import "./Home.css";
import { AiOutlineSearch } from "react-icons/ai";
import homeImg from "../../images/model-3.jpg";

const Home = () => {
  return (
    <>
      <div className="home">
        <form action="">
          <div className="text">
            <label>Where</label>
            <input className="text_input" type="text" placeholder="Search Location" />
          </div>
          <div className="from">
            <span className="border"></span>
            <label>From</label>
            <input type="date" />
          </div>
          <div className="until">
            <span className="border"></span>
            <label>Until</label>
            <input type="date" />
          </div>
          <div className="search_btn">
            <AiOutlineSearch className="btnIcon"/>
            <button>Search for cars</button>
          </div>
        </form>
      </div>
    </>
  );
};
export default Home;
